Join us on August 19th for a powerful cause! Together, we'll run against human trafficking during the 6th Annual Vibe Mural Festival - Benefit Tattoo Flash Day supporting @RunAgainstTraffic Let's ink hope and make a difference! #EndHumanTrafficking #VibeMuralFestival #RunAgainstTraffic #InkForChange

@xmikextattoos will be tackling a huge mural on the side of the building for the entirety of the festival. We will also have multiple sponsored vendors and a food truck to help support the day. If you’d like to become a sponsor, please shoot us a message!
